CREATE TABLE "NMT2"."ABONNEMENT"
(
    TJENESTE_ID NUMBER NOT NULL,
    KEY varchar2(4000) NOT NULL,
    DATA clob,
    SLUTT_DATO timestamp,
    SIST_ENDRET timestamp DEFAULT SYSDATE  NOT NULL,
    PARTNER_ID NUMBER NOT NULL,
    MOTTAK_ID varchar2(50),
    AB_ID NUMBER PRIMARY KEY NOT NULL
);
ALTER TABLE "NMT2"."ABONNEMENT"
    ADD CONSTRAINT ABONNEMENT_PARTNER_FK1
        FOREIGN KEY (PARTNER_ID)
            REFERENCES "PARTNER"(PARTNER_ID);
ALTER TABLE "NMT2"."ABONNEMENT"
    ADD CONSTRAINT ABONNEMENT_TJENESTE_FK1
        FOREIGN KEY (TJENESTE_ID)
            REFERENCES "TJENESTE"(TJENESTE_ID);
CREATE INDEX ABON_PARTNERID_INDEX ON "ABONNEMENT"(PARTNER_ID);
CREATE UNIQUE INDEX TJEN_KEY_UK1 ON "ABONNEMENT"
(
  TJENESTE_ID,
  KEY
);


